import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar } from 'react-bootstrap';


function App() {
  return (

    <div className="App">

      <Navbar bg="mmColour" fixed="top" variant="dark" expand="sm" collapseOnSelect>
        {/* <Container> */}
        <div className="mx-2">

          </div>
          <Navbar.Brand id="navBrand">MarketManager
          </Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse>
            <Nav className="navLinks">
              <Nav.Link href="#" variant="primary">Home</Nav.Link>
              <Nav.Link href="#">My Account</Nav.Link>
              <Nav.Link href="#">Help</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        {/* </Container> */}
      </Navbar>


      <div className="content">
        This is content.
      </div>
    </div>


  );
}

export default App;
